	(11, 'metric system', '公制', '公制是一完全创新的单位制度，又称米千克秒（MKS或mks）单位制，建立在下述三种基本单位之上：米-用来确定距离，千克-用来确定质量，和秒-用来确定时间长度。它根基于科学的原则,且满足日益频繁的商业活动和科学研究的需求。\r\n公制单位出现于法国大革命时代。', 1),
	(14, 'british system', '英制', '英国、美国等英语国家使用的一种度量制。长度主单位为英尺，重量主单位为磅，容积主单位为加仑，温度单位为华氏度。\r\n因为各种各样的历史原因，英制的进制相当繁杂。在使用场合方面，日常生活中一般用英制；但英国法律规定，商业零售必须使用公制；在科学领域，英国人习惯用公制，美国人习惯用英制。', 5),
	(16, 'AAA', '市制', '', 10);
